<script setup>
import { onMounted, ref } from 'vue'

onMounted(() => {
  ;(roket = document.querySelector('.rocket')),
    (scale = document.querySelector('.block-left')),
    (timer = document.querySelector('.block-right')),
    (countdown = document.querySelector('#caunt')),
    (sec = document.querySelector('#sec'))
  min = document.querySelector('#min')

  gameStart()
})
let counter = 10000,
  scroll = 0,
  time,
  int,
  fac,
  scrolling,
  minute = 0,
  roket,
  scale,
  timer,
  countdown,
  sec,
  min,
  second = 5

const tick = 1000

const coffList = ref(null)

const fetchCoef = async () => {
  await fetch('https://banter1.win/api/crash/init/test', { method: 'POST' })
    .then((res) => res.json())
    .then((responce) => {
      coffList.value = responce.history.slice(0, 5)
    })
}
fetchCoef()

const colorCoff = (coff) => {
  if (coff <= 1.2) {
    return 'red'
  } else if (coff > 1.2 && coff < 2) {
    return 'gray'
  } else if (coff > 2 && coff < 5) {
    return 'blue'
  } else if (coff > 5 && coff < 10) {
    return 'green'
  } else if (coff > 10) {
    return 'gold'
  }
}

const gameStart = () => {
  scroll = 0

  document.querySelector('#player').textContent = 0

  document.querySelector('.canvas').style = `bottom: ${scroll}px`
  document.querySelector('.rocket-explosion').classList.remove('rocket-explosion-crash')
  roket.classList.remove('fly-rocket')
  roket.style = 'opacity: 1'

  int = setInterval(() => {
    counter <= 10000
      ? (countdown.textContent = `0${(counter - tick) / 1000}`)
      : (countdown.textContent = (counter - tick) / 1000)
    counter -= tick
    if (counter <= 0) {
      clearInterval(int)
      counter = 10000
      countdown.textContent = `10`
      countdown.parentElement.parentElement.style = 'opacity: 0'

      timer.classList.toggle('off')
      scale.classList.toggle('off')

      roket.classList.add('fly-rocket')
      setTimeout(() => {
        roket.style.cssText = 'bottom: 23px;animation: shakeShip 0.2s infinite; '
      }, 1000)

      gameTimer(minute, second)
      gameScale()
      gameScroll()
    }
  }, tick)
}
const gameTimer = (minut, secon) => {
  const sec = document.querySelector('#sec')
  const min = document.querySelector('#min')

  let s = 0,
    m = 0

  time = setInterval(() => {
    if (s < tick * 60) {
      s < tick * 10 ? (sec.textContent = `0${s / 1000}`) : (sec.textContent = `${s / 1000}`)
    }
    if (m < tick * 60) {
      m < tick * 10 ? (min.textContent = `0${m / 1000}`) : (min.textContent = `${m / 1000}`)
    }

    if (m === minut * 1000 && s === secon * 1000) {
      document.querySelector('.rocket-explosion').classList.add('rocket-explosion-crash')
      stopTimer(time)
      stopTimer(fac)
      stopTimer(scrolling)

      roket.style = ''
      roket.style.cssText = 'opacity: 0;bottom:-160px'

      setTimeout(gameReload, 3000)
    }

    s += tick
    if (s >= 60 * tick) {
      m += tick
      s -= 60 * tick
    }
  }, tick)
  const stopTimer = (t) => {
    clearInterval(t)
  }
}
const gameScale = () => {
  const facto = document.querySelector('#factor'),
    sc = document.querySelectorAll('.scale')
  let t = 100,
    s = 50,
    fl = 0,
    res = 0

  sc.forEach((item) => {
    item.classList.add('gray')
  })
  fac = setTimeout(function set() {
    t += 1
    if (t >= 100) {
      fl = `00`
      res++
      t -= 100
    } else if (t < 10) {
      fl = `0${t}`
    } else {
      fl = t
    }

    if (res >= 10) {
      s = 10
      sc.forEach((item) => {
        item.classList.remove('green')
        item.classList.add('gold')
        document.querySelector('.scale').style = 'width: 175px'
        if (res >= 100) {
          document.querySelector('.scale').style = 'width: 190px'
        }
      })
    } else if (res >= 5) {
      s = 20
      sc.forEach((item) => {
        item.classList.remove('blue')
        item.classList.add('green')
      })
    } else if (res >= 2) {
      s = 35
      sc.forEach((item) => {
        item.classList.remove('gray')
        item.classList.add('blue')
        document.querySelector('.scale').style = 'width: 145px'
      })
    }

    facto.textContent = `${res}.${fl}`

    fac = setTimeout(set, s)
  }, s)
}
const gameScroll = () => {
  scroll = 0

  scrolling = setInterval(() => {
    document.querySelector('.canvas').style = `bottom: ${scroll}px`
    scroll--
  }, 1)
}
const gameReload = () => {
  setTimeout(() => {
    timer.classList.toggle('off')
    scale.classList.toggle('off')

    sec.textContent = `00`
    min.textContent = `00`

    countdown.parentElement.parentElement.style = 'opacity: 1'
    gameStart()

    document.querySelector('#bets').textContent = `0.00`
  }, 1000)
}
</script>

